import { useEffect, useState } from 'react';
import axios from 'axios';

const Home = () => {
    const [profile, setProfile] = useState(null);
    useEffect(() => {
        const getProfile = async () => {
            try {
                const response = axios.fet("/auth/profile");
                setProfile(response);
            } catch (error) {
                console.log(error)
            }
        }
        getProfile()
    }, [])
    return (
        <div>
            <h1>{profile.disordUsername}</h1>
        </div>
    )
}

export default Home;
